import React, { Fragment } from 'react';

const Props = (props) => {
    //console.log(props.PropsReact);
    return (
        <Fragment>
            <h1>{props.PropsReact.id}</h1>
            <h1>{props.PropsReact.namee}</h1>
            <h1>{props.PropsReact.mobile}</h1>
        </Fragment>
    )
}
export default Props;
